import './App.css';
import './App.scss';

import MainContainer from "./components/MainContainer";

function App() {


  return (
    <div className="App">
      <MainContainer />
      <div class="flx-embed"><div style="position:relative; height:0; padding-bottom:56.25%; width:100%"><iframe style="position:absolute; top:0; left:0; width:100%; height:100%;" src="https://media.flixel.com/cinemagraph/asnaoe1kgb4p55jane4m?hd=true" frameborder="0" allowfullscreen allow='autoplay'></iframe></div></div>

    </div>
  );
}

export default App;
